import React, { useState, useEffect } from 'react';
import { getProductos, getProductoCategorias } from '../services/api';
import { Card, Col, Container, 
		Row, Button, Modal, 
		Form, InputGroup, FloatingLabel } from 'react-bootstrap';

function Home() {
	const [productos, setProductos] = useState([]);
	const [editProductId, setEditProductId] = useState(null);
	const [deleteId, setDeleteId] = useState(null);
	const [category, setCategory] = useState(null);
	
	useEffect(() => {
		const fetchProductos = async () => {
			try {
				const res = await getProductos();
				setProductos(res.data); // Asegúrate de acceder a .data
			} catch (err) {
				console.error('Error al obtener productos:', err);
			}
		};
		fetchProductos();
	}, []);

	return (
		<Container className="my-3">
			<Row>
			{productos.map(producto => (
			  <Col 
			  key={producto.id} 
			  className="mb-3"
			  >
			    <Card>
			      <Card.Body>
			        <Card.Title>{producto.name}</Card.Title>
			        <Card.Text>{producto.price}</Card.Text>
			        <div xs="auto">
			          <Button
			            onClick={() => setEditProductId(producto.id)}
			            size="sm"
			            variant="secondary"
			            className="mx-1"
			          >
			            Editar
			          </Button>
			          <Button
			            onClick={() => setDeleteId(producto.id)}
			            size="sm"
			            variant="dark"
			            className="mx-1"
			          >
			            Eliminar
			          </Button>
			        </div>
			      </Card.Body>
			    </Card>

			    {/* Edit Modal */}
			    <Modal
			      show={editProductId === producto.id}
			      onHide={() => setEditProductId(null)}
			    >
			      <Modal.Header closeButton>
			        <Modal.Title>Editando {producto.name}</Modal.Title>
			      </Modal.Header>
			      <Modal.Body>
				  	<Form>
						<Row>
						<FloatingLabel
						        controlId="floatingInput"
						        label="Nombre del producto"
						        className="mb-3"
						      >
							  <Form.Control
                                  type="text"
                                  defaultValue={producto.name}
                                  placeholder="Nombre del producto"
                              />
							 </FloatingLabel>
						</Row>
						<Row>
							<Form.Group as={Col}>
		                        <Form.Label>Precio</Form.Label>
		                        <InputGroup>
		                            <InputGroup.Text>$</InputGroup.Text>
		                            <Form.Control
		                                type="number"
		                                defaultValue={producto.price}
		                                placeholder="Precio del producto"
		                            />
		                        </InputGroup>
							</Form.Group>
						</Row>
						<Row className="m-2">
						<Form.Check
					        type="switch"
							defaultChecked={producto.active}
					        label="Producto activo"
					      />
						</Row>
					</Form>
				  </Modal.Body>
			      <Modal.Footer>
			        <Button variant="secondary" onClick={() => setEditProductId(null)}>
			          Close
			        </Button>
			        <Button variant="primary" onClick={() => setEditProductId(null)}>
			          Save Changes
			        </Button>
			      </Modal.Footer>
			    </Modal>

			    {/* Delete Modal */}
			    <Modal
			      show={deleteId === producto.id}
			      onHide={() => setDeleteId(null)}
			    >
			      <Modal.Header closeButton>
			        <Modal.Title>Eliminar {producto.name}</Modal.Title>
			      </Modal.Header>
			      <Modal.Body>
			        Seguro que quieres borrar {producto.name}?
			      </Modal.Body>
			      <Modal.Footer>
			        <Button variant="secondary" onClick={() => setDeleteId(null)}>
			          Cancel
			        </Button>
			        <Button variant="danger" onClick={() => setDeleteId(null)}>
			          Delete
			        </Button>
			      </Modal.Footer>
			    </Modal>
			  </Col>
			))}
			</Row>
		</Container>
	);
}

export default Home;
